import React, { useEffect, useState } from 'react';
import styles from './Nastavnici.module.css';

function Nastavnici() {
  const [backendData, setBackendData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3001/nastavnici')
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setBackendData(data);
      });
  }, []);

  return (
    <div>
      {typeof backendData.nastavnici === 'undefined' ? (
        <p>Loading...</p>
      ) : (
        backendData.nastavnici.map((nastavnik, i) => {
          return (
            <div
              className={styles[nasatvnici - card]}
              key={i}
              style={{ display: 'flex', alignItems: 'center' }}
            >
              <p>{nastavnik.ime} </p>
              <p>{nastavnik.prezime}</p>
              <a href="/:id">Details</a>
            </div>
          );
        })
      )}
    </div>
  );
}

export default Nastavnici;
